import React, { Component } from "react";
import NavigationBar from "../../components/NavigationBar/NavigationBar";
import "./../../App.css";
import "./ActiveChats.css"


export default function ActiveChats () {
  return (
<div>
     <header>
        <img
                src={require('./../../graphics/app_logo_small.png')} 
                alt="app_logo_small" 
                height='40' 
                width ='40'></img>

        <div className="centering">
            <div className="title">
                <div className="app-headline">Active Chats</div>
            </div>
        </div>
    </header>

    <div>
        {/*Insert active chats list here*/}
    </div>



    <div className="centering">
        <NavigationBar />
    </div>

</div>

)
}
